import React, { useState } from 'react';

function fetchUser() {
    axios.get('http://localhost:8080/hcl/add/2/5', {
        method: 'GET',
        mode: 'no-cors',
        credentials: 'include',
        headers: {
          'content-type': 'application/json',
          dataType: 'json'
        }
      .then( response => {
        console.log("response", response);
        this.setState({
          fetchUser: response.data
        });
        console.log("fetchUser", this.state.fetchUser)
      })
      .catch( error => {
        console.log(error)
      })
    })
}

  

